import YmapPlugin from 'vue-yandex-maps'


export default ({ app }) => {
  const mapOpts = {
    apiKey: 'ff37a483-416c-4661-8877-cc44eb1abf7b',
  }

  app.use(YmapPlugin, mapOpts);

  app.config.globalProperties.$yMarker = {
    layout: 'default#image',
    imageHref: getMarker(),
  }
}

function getMarker() {
  return 'data:image/svg+xml;base64,'
}
